          Type:{' '}
          <select value={inputType} onChange={(e) => setInputType(e.target.value)}>
            <option value="Text">Text</option>
            <option value="File">File</option>
          </select>
        </label>
      </>

  );
};

export const LLMNode = createNode({
  title: 'LLM',
  inputs: [
    { id: 'system' },
    { id: 'prompt' }
